I may have found one of my new favourite spots for Chinese donuts also known as youtiao 油條/油条😍 We had a fun insiders peek at how Chef Tian makes this traditional staple and my husband even tried his hand at making one 🤣 How did he do? So fluffy and so fresh...which is hard to find! They pair super well with the Fresh Tomato Beef Stew but are equally great on their own. We also got to try their Szechuan Boiled Fish and we loved it! Honestly it looks spicier than it is and I would rate it mild (just don't eat the peppers lol). It comes with ice cream at the end and it's so tasty wirh their signature chili flakes🍦🌶

@chef_tian10 is located 1010-4711 McClelland Rd in Richmond ✌️

